[[package]]
name = "anyio"
version = "3.6.2"
requires_python = ">=3.6.2"
summary = "High level compatibility layer for multiple asynchronous event loop implementations"
dependencies = [
    "idna>=2.8",
    "sniffio>=1.1",
]

[[package]]
name = "autopep8"
version = "2.0.0"
summary = "A tool that automatically formats Python code to conform to the PEP 8 style guide"
dependencies = [
    "pycodestyle>=2.9.1",
    "tomli",
]

[[package]]
name = "fastapi"
version = "0.87.0"
requires_python = ">=3.7"
summary = "FastAPI framework, high performance, easy to learn, fast to code, ready for production"
dependencies = [
    "pydantic!=1.7,!=1.7.1,!=1.7.2,!=1.7.3,!=1.8,!=1.8.1,<2.0.0,>=1.6.2",
    "starlette==0.21.0",
]

[[package]]
name = "flake8"
version = "5.0.4"
requires_python = ">=3.6.1"
summary = "the modular source code checker: pep8 pyflakes and co"
dependencies = [
    "mccabe<0.8.0,>=0.7.0",
    "pycodestyle<2.10.0,>=2.9.0",
    "pyflakes<2.6.0,>=2.5.0",
]

[[package]]
name = "greenlet"
version = "2.0.1"
requires_python = ">=2.7,!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*"
summary = "Lightweight in-process concurrent programming"

[[package]]
name = "idna"
version = "3.4"
requires_python = ">=3.5"
summary = "Internationalized Domain Names in Applications (IDNA)"

[[package]]
name = "mccabe"
version = "0.7.0"
requires_python = ">=3.6"
summary = "McCabe checker, plugin for flake8"

[[package]]
name = "pycodestyle"
version = "2.9.1"
requires_python = ">=3.6"
summary = "Python style guide checker"

[[package]]
name = "pydantic"
version = "1.10.2"
requires_python = ">=3.7"
summary = "Data validation and settings management using python type hints"
dependencies = [
    "typing-extensions>=4.1.0",
]

[[package]]
name = "pyflakes"
version = "2.5.0"
requires_python = ">=3.6"
summary = "passive checker of Python programs"

[[package]]
name = "sniffio"
version = "1.3.0"
requires_python = ">=3.7"
summary = "Sniff out which async library your code is running under"

[[package]]
name = "sqlalchemy"
version = "1.4.44"
requires_python = "!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*,!=3.5.*,>=2.7"
summary = "Database Abstraction Library"
dependencies = [
    "greenlet!=0.4.17; python_version >= \"3\" and (platform_machine == \"aarch64\" or (platform_machine == \"ppc64le\" or (platform_machine == \"x86_64\" or (platform_machine == \"amd64\" or (platform_machine == \"AMD64\" or (platform_machine == \"win32\" or platform_machine == \"WIN32\"))))))",
]

[[package]]
name = "starlette"
version = "0.21.0"
requires_python = ">=3.7"
summary = "The little ASGI library that shines."
dependencies = [
    "anyio<5,>=3.4.0",
]

[[package]]
name = "tomli"
version = "2.0.1"
requires_python = ">=3.7"
summary = "A lil' TOML parser"

[[package]]
name = "typing-extensions"
version = "4.4.0"
requires_python = ">=3.7"
summary = "Backported and Experimental Type Hints for Python 3.7+"

